(function(){'use strict';var module=angular.module('app.organization',['ui.router','ngResource','app.resource','app.common']);module.config(appConfig);appConfig.$inject=['$stateProvider'];function appConfig($stateProvider){$stateProvider.state('app.organization',{url:'/organization/:id',templateUrl:'app/modules/entities/organization/list/organization.html',resolve:{organization:['$stateParams','organizationResource','OrganizationFactory','UserFactory','$http','$rootScope',function($stateParams,organizationResource,OrganizationFactory,UserFactory,$http,$rootScope){UserFactory.getProfile().then(function(response){var user=response.data;OrganizationFactory.getOrganization().then(function(response){for(var i=0;i<response.data.length;i++){if(response.data[i]._id==user.orgId&&user.orgId){$rootScope.organization=response.data[i];}}return $rootScope.organization;});})}]},controller:'OrganizationListController',controllerAs:'vm'}).state('app.editOrganization',{url:'/organization/edit/:id',templateUrl:'app/modules/entities/organization/edit/edit.html',resolve:{data:['$stateParams','organizationResource',function($stateParams,organizationResource){return $stateParams.id?organizationResource.get({id:$stateParams.id}).$promise:{};}]},controller:'OrganizationController',controllerAs:'vm'});}})();